import './navigation.css';
const elemNavigation = [
    {id: 1, class: 'nav-home', value: 'Home'},
    {id: 2, class: 'nav-contacts', value: 'Contacts'},
    {id: 3, class: 'nav-home', value: 'Call me'},
    {id: 4, class: 'nav-home', value: 'Store'},
    {id: 5, class: 'nav-home', value: 'Support'},
]

export default function Navigation() {
    return (
        <aside className="navigation">
            <ul>
                <li>
                    <a className="nav-home">Home</a>
                </li>
            </ul>
        </aside>
    )
}
